import React from 'react';
import { Droppable } from 'react-beautiful-dnd'

import Item from './item';
import GoogleMap from './googlemap';

function BoardHorizontal(props) {

    const {column, places} = props;

    return (
        <div className='board-places'>
            <h3>{column.title}</h3>
            <Droppable 
                droppableId={column.id}
                direction="horizontal"
            >
                {(provided) => (
                    <div className='droppable-horizontal'
                        ref={provided.innerRef}
                        {...provided.droppableProps}
                    >
                        {places.map((place, index) => <Item key={place.id} place={place} index={index}/>)}
                        {provided.placeholder}
                    </div>
                )}
            </Droppable>
            <GoogleMap places={places}/>
        </div>
    );
}

export default BoardHorizontal;
